      {
        EMR_ASESMEN_ULANGPERAWATGIGI_HasilNIPSA.innerHTML = "Relaxed (wajah tenang, ekspresi netral)";
      }
      else
      {
        EMR_ASESMEN_ULANGPERAWATGIGI_HasilNIPSA.innerHTML = "Grimace (otot wajah tegang, alis berkerut, dagu dan rahang tegang)";
      }

      var EMR_ASESMEN_ULANGPERAWATGIGI_HasilSN_NIPSB = $("input[name='EMR_ASESMEN_ULANGPERAWATGIGI_SN_NIPSB']:checked").val();
